function initMap() {
  var philly = {lat: 39.9525839, lng: -75.16522150000003};
  var map = new google.maps.Map(document.getElementById('map'), {
    zoom: 15,
    center: philly
  });

  var marker = new google.maps.Marker({
    position: philly,
    map: map,
    title: 'philly'
  });

  // Enter address
  document.getElementById('btn').onclick = function() {
    var geocoder = new google.maps.Geocoder();

    var search = document.getElementById('address').value;
    console.log(search);
    geocodeAddress(geocoder, map);
    map.setZoom(16);
  }

  // Didn't get towed
  document.getElementById('noTow').onclick = function() {
    var center = map.getCenter();
    var lat = center.lat();
    var lng = center.lng();
    addCircle(lat, lng, '#00b200', map);
    console.log(lat + " " + lng);
  }

  // Got towed
  document.getElementById('gotTowed').onclick = function() {
    var center = map.getCenter();
    var lat = center.lat();
    var lng = center.lng();
    addCircle(lat, lng, '#FF0000', map);
    console.log(lat + " " + lng);
  }

  console.log(testData);

  for (index = 0, len = testData.meter_lines.length; index < len; ++index) {
    addLine(testData.meter_lines[index].blat, testData.meter_lines[index].blon, testData.meter_lines[index].elat, testData.meter_lines[index].elon, map, testData.meter_lines[index], '#00b200');
  }

  for (index = 0, len = testData.zone_lines.length; index < len; ++index) {
    addLine(testData.zone_lines[index].blat, testData.zone_lines[index].blon, testData.zone_lines[index].elat, testData.zone_lines[index].elon, map, testData.zone_lines[index], '#0000FF');
  }

  for (index = 0, len = violationData.length; index < len; ++index) {
    var lat; var lng;
    if (violationData[index].Latitude > 0) {
      console.log('lat: ' + lat + ' lng: ' + lng);
      lat = violationData[index].Latitude;
      lng = violationData[index].Longitude;
    } else {
      lng = violationData[index].Latitude;
      lat = violationData[index].Longitude;
    }
    addCircle(lat, lng, '#FF0000', map);
  }
}

